import React from 'react';
import s from './Navbar.module.css'
import { NavLink } from 'react-router-dom';
const Navbar = ()=>{
    return(
<div className={s.navbar}>
  <div><NavLink to='/general' activeClassName={s.activeLink}>ГЛАВНАЯ</NavLink></div>
  <div><NavLink to='/general' activeClassName={s.activeLink}>О НАС</NavLink></div>
  <div><NavLink to='/general' activeClassName={s.activeLink}>ПОРТФОЛИО</NavLink></div>
  <div><NavLink to='/general' activeClassName={s.activeLink}>ОТЗЫВЫ</NavLink></div>
  <NavLink to='/aboutUs' activeClassName={s.activeLink}><span>О НАС</span></NavLink>
  <NavLink to='/portfolio' activeClassName={s.activeLink}><span>ПОРТФОЛИО</span></NavLink>
  <NavLink to='/reviews' activeClassName={s.activeLink}><span>ОТЗЫВЫ</span></NavLink>
</div>
    );
};

export default Navbar;
